// This is the BinaryMatrix's API interface.
// You should not implement it, or speculate about its implementation
type BinaryMatrix struct {
	n     int
	m     int
	mat   [][]int
	Count int
}

func NewBinaryMatrix(values [][]int) BinaryMatrix {
	return BinaryMatrix{
		mat: values,
		n:   len(values),
		m:   len(values[0]),
	}
}

func (b *BinaryMatrix) Get(i int, j int) int {
	b.Count += 1
	return b.mat[i][j]
}

func (b BinaryMatrix) Dimensions() []int {
	return []int{b.n, b.m}
}

func leftMostColumnWithOne(bm BinaryMatrix) int {
	dim := bm.Dimensions()
	n, m := dim[0], dim[1]
	i, j := 0, m-1
	for i < n && j >= 0 {
		switch bm.Get(i, j) {
		case 0:
			i++
		case 1:
			j--
		}
	}
	if j == m-1 {
		return -1
	}
	return j + 1
}
